logger = logging.getLogger(__name__)

def get_team_radio_from_api(session: fastf1.core.Session) -> pd.DataFrame:
    """
    Fetch team radio data from the FastF1 API for a given session.
    
    Args:
        session (fastf1.core.Session): The FastF1 session object
        
    Returns:
        pd.DataFrame: DataFrame containing team radio data with columns:
            - SessionTime: Time in the session
            - UtcTime: UTC timestamp
            - RacingNumber: Driver's racing number
            - Path: Path to the MP3 file
    """
    try:
        # Get the session date in YYYY-MM-DD format
        session_date = session.date.strftime('%Y-%m-%d')
        
        # Construct the API URL
        url = f"https://livetiming.formula1.com{session.api_path}TeamRadio.jsonStream"
        
        response = requests.get(url, stream=True)
        response.raise_for_status()
        
        processed_data = []
        for line in response.iter_lines():
            if not line:
                continue
            # Decode bytes to string if needed
            line = line.decode('utf-8')
            # Find the first curly brace to split timestamp and JSON
            brace_idx = line.find('{')
            if brace_idx == -1:
                continue  # Malformed line
            session_time = line[:brace_idx].strip().lstrip('\ufeff')  # Remove BOM if present
            json_str = line[brace_idx:]
            try:
                data = json.loads(json_str)
                captures = data.get('Captures', {})
                # Captures can be a list or a dict
                if isinstance(captures, list):
                    capture_items = captures
                elif isinstance(captures, dict):
                    capture_items = captures.values()
                else:
                    continue
                for capture in capture_items:
                    utc_time = capture.get('Utc')
                    racing_number = str(capture.get('RacingNumber'))
                    path = capture.get('Path')
                    if all([session_time, utc_time, racing_number, path]):
                        processed_data.append({
                            'SessionTime': session_time,
                            'UtcTime': utc_time,
                            'RacingNumber': racing_number,
                            'Path': path
                        })
            except Exception as e:
                logger.error(f"Error parsing or processing line: {e}")
                continue
        df = pd.DataFrame(processed_data)
        if df.empty:
            logger.warning("No valid team radio data could be processed")
            return df
        # Convert time columns to datetime where possible
        try:
            df['SessionTime'] = pd.to_datetime(df['SessionTime'])
        except Exception:
            pass
        try:
            df['UtcTime'] = pd.to_datetime(df['UtcTime'])
        except Exception:
            pass
        df = df.sort_values('SessionTime')
        logger.info(f"Successfully processed {len(df)} team radio messages")
        return df
    except requests.exceptions.RequestException as e:
        logger.error(f"Error fetching team radio data: {e}")
        return pd.DataFrame()
    except Exception as e:
        logger.error(f"Unexpected error in get_team_radio_from_api: {e}")
        return pd.DataFrame()

def download_team_radio_mp3(session: fastf1.core.Session, path: str) -> Optional[str]:
    """
    Download team radio MP3 file for a given session and path.

    Args:
        session (fastf1.core.Session): The FastF1 session object, used to provide the api_path for the event.
        path (str): Path to the MP3 file (relative, e.g., 'TeamRadio/...') as provided in the team radio metadata.

    Returns:
        Optional[str]: Path to the downloaded MP3 file if successful, None otherwise.
    """
    try:
        url = f"https://livetiming.formula1.com{session.api_path}{path}"
        temp_file = tempfile.NamedTemporaryFile(suffix='.mp3', delete=False)
        temp_file.close()
        response = requests.get(url)
        response.raise_for_status()
        with open(temp_file.name, 'wb') as f:
            f.write(response.content)
        return temp_file.name
    except Exception as e:
        logger.error(f"Error downloading team radio MP3: {e}")
        if os.path.exists(temp_file.name):
            os.unlink(temp_file.name)
        return None

