def transcribe_all_team_radio(session: fastf1.core.Session, 
                            radio_df: pd.DataFrame, 
                            whisper_model_name: str = "base") -> pd.DataFrame:
    """
    Transcribe all team radio messages in the given DataFrame.
    Args:
        session (fastf1.core.Session): The FastF1 session object
        radio_df (pd.DataFrame): DataFrame containing team radio metadata
        whisper_model_name (str): Name of the Whisper model to use
    Returns:
        pd.DataFrame: DataFrame containing transcribed messages with columns:
            - SessionTime: Time in the session
            - UtcTime: UTC timestamp
            - DriverNumber: Driver's racing number
            - MessageText: Transcribed message text
    """
    if radio_df.empty:
        logger.warning("No team radio data to transcribe")
        return pd.DataFrame()
        
    required_columns = ['SessionTime', 'UtcTime', 'RacingNumber', 'Path']
    if not all(col in radio_df.columns for col in required_columns):
        logger.error(f"Input DataFrame missing required columns: {required_columns}")
        return pd.DataFrame()
    
    transcribed_data = []
    
    for _, row in radio_df.iterrows():
        mp3_path = None
        try:
            # Download the MP3 file using the Path field
            mp3_path = download_team_radio_mp3(session,row['Path'])
            if not mp3_path:
                continue
                
            # Transcribe the audio
            transcription = transcribe_audio_file(mp3_path, whisper_model_name)
            if not transcription:
                continue
                
            # Add to our results
            transcribed_data.append({
                'SessionTime': row['SessionTime'],
                'UtcTime': row['UtcTime'],
                'DriverNumber': row['RacingNumber'],
                'MessageText': transcription
            })
            
        except Exception as e:
            logger.error(f"Error processing radio message: {e}")
            continue
        finally:
            # Clean up the temporary MP3 file
            if mp3_path and os.path.exists(mp3_path):
                os.unlink(mp3_path)
    
    return pd.DataFrame(transcribed_data)

